Господь, лепя людей со скуки, бывал порою скуповат, и что частично вышли суки, он сам отчасти виноват. ...(И.М. Губерман) 

Человек - это тайна, в которой замыкается мира картина, совмещаются фауна с флорой, сочетаются дуб и скотина. ...(И.М. Губерман)

Прошлых песен у нас не отнять, в нас пожизненна русская нота: я ликую, узнав, что опять объебли россияне кого-то. ...(И.М. Губерман)  

Когда устал и жить не хочешь, полезно вспомнить в гневе белом, что есть такие дни и ночи, что жизнь оправдывают в целом. ...(И.М. Губерман) 

О себе: Напрасно совесть тягомотная в душе моей свербит на дне: я человек - ничто животное не чуждо мне. ...(И.М. Губерман)

ревняя молитва

Господи, Боже Мой!
Удостой меня быть орудием мира Твоего,
чтобы я вносил любовь туда, где ненависть;
чтобы я прощал, где обижают;
чтобы я соединял, где ссора;
чтобы я говорил правду, где заблуждение;
чтобы я воздвигал веру, где давит сомнение;
чтобы я возбуждал надежду, где отчаяние;
чтобы я вносил свет туда, где тьма;
чтобы я возбуждал радость, где горе живет.
Господи, Боже мой! Удостой,
не чтобы меня утешали, но чтобы я утешал;
не чтобы меня понимали, но чтобы я понимал;
не чтобы меня любили, но чтобы я любил.
Ибо кто дает, тот получает;
кто себя забывает, тот обретает;
кто прощает, тому проститься;
кто умирает, тот просыпается в вечной жизни.

